    import ProjectCard from "../../customComponents/ProjectCard.svelte";
    import InfiniteLoading from 'svelte-infinite-loading';
    import PostCardSkeleton from '../../customComponents/PostCardSkeleton.svelte';
    import { BACKEND_URL } from '@/constant/base';
    export let data;
    const {accessToken,refreshToken} = data;
    let page = 1;
    let projects:any = [];
    let search = '';
    let status = '';
	let infiniteId = Symbol();
    function infiniteHandler({ detail: { loaded, complete } }) {
		fetch(`${BACKEND_URL}/v1/project/public?limit=10&page=${page}&search=${search}&status=${status}`,
            {
                method: 'GET',
                headers: {
                    'Authorization': `Bearer ${accessToken}`
                }
            }
        )
			.then(response => response.json())
			.then(async(data) => {
                console.log(search);
        if (data.projects.length > 0) {
          projects = [...projects, ...data.projects];
          loaded();
          page += 1; 
        }
        else{
            complete();
        }
      });
	}

    function changeType() {
		page = 1;
		projects = [];
		infiniteId = Symbol();
	}

    
</script>

 

